package Operators;

class Relational {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int g = 10;
		 int h = 20;
		 System.out.println("g == h = " + (g == h) ); // false
		 System.out.println("g != h = " + (g != h) ); // true
		 System.out.println("g > h = " + (g > h) ); // false
		 System.out.println("g < h = " + (g < h) ); //true
		 System.out.println("h >= g = " + (h >= g) ); // true
		 System.out.println("h <= g = " + (h <= g) ); // false

	}

}
